11.body:
AWS Lambda function that takes a timezone code as request parameter and returns the local date and time. Currently supports AEST, EST, PST, MST. Defaults to UTC if blank request parameter. Example # request
{ "tz_code": "AEST"
} # response
{ "req_id": "2b0d6b70-09d8-4a78-8180-e1abe33eb5fb", "msg": "It is 08 February 2023 6:33:39 AM in AEST"
}
